import { Text, View } from "react-native";

const Bubble = ({text}) =>{
    return(
        <View style={{alignSelf: 'end'}}>
            <Text style={{fontSize:18}}>   {text}</Text>
            <Text style={{fontSize:18}}>  /</Text> 
        </View>
    )
}

export default Bubble;
